import React from "react";
import { useSelector } from "react-redux";
import "./DashBoard.css";
import Card from "../Card/Card";

// Importing SVGs as components
import BacklogIcon from "./icons-FTask/Backlog.svg";
/*import TodoIcon from "../path-to-icons/To-do.svg";
import InProgressIcon from "../path-to-icons/in-progress.svg";
import DoneIcon from "../path-to-icons/Done.svg";
import CancelledIcon from "../path-to-icons/Cancelled.svg";

import LowPriorityIcon from "../path-to-icons/Img - Low Priority.svg";
import MediumPriorityIcon from "../path-to-icons/Img - Medium Priority.svg";
import HighPriorityIcon from "../path-to-icons/Img - High Priority.svg";
import UrgentPriorityIcon from "../path-to-icons/SVG - Urgent Priority colour.svg";
import NoPriorityIcon from "../path-to-icons/No-priority.svg";

import ThreeDotMenu from "../path-to-icons/3 dot menu.svg";
import AddIcon from "../path-to-icons/add.svg";*/

const DashBoard = () => {
  const isStatus = localStorage.getItem("group") === "status";
  const isPriority = localStorage.getItem("group") === "priority";
  console.log("stat", isStatus, "prio", isPriority);

  const { selectedData, user } = useSelector(
    (state) => state.SelectDataReducer
  );
  console.log("rere", user);

  return (
    selectedData && (
      <div className="dashContainer" style={{ display: "flex", justifyContent: "space-around" }}>
        {selectedData.map((element, index) => {
          const cardWidthPercentage = 18.7;
          return (
            <div key={index} className="dashCardContainer" style={{ width: `${cardWidthPercentage}%` }}>
              <div className="dashCardHeading flex-sb">
                <div className="leftView">
                  {user ? (
                    <div className="imageContainer relative" style={{
                      width: "10px", height: "15px", display: "inline-block",
                    }}>
                      {/* User Image placeholder */}
                    </div>
                  ) : isStatus ? (
                    <div className="cardTitle" style={{
                      width: "15px", height: "15px", display: "inline-block", fontWeight: 200,
                    }}>
                      {element[index].title === "Backlog" ? (
                        <BacklogIcon style={{ width: "13px" }} />
                      ) : element[index].title === "Todo" ? (
                        <TodoIcon style={{ width: "13px", color: "#ddeded" }} />
                      ) : element[index].title === "In progress" ? (
                        <InProgressIcon style={{ width: "13px", color: "#f2d750" }} />
                      ) : element[index].title === "Done" ? (
                        <DoneIcon />
                      ) : (
                        <CancelledIcon />
                      )}
                    </div>
                  ) : isPriority ? (
                    <div className="tags color-grey" style={{
                      width: "35px", height: "30px", display: "inline-block",
                    }}>
                      {element[index].title === "Low" ? (
                        <LowPriorityIcon />
                      ) : element[index].title === "Medium" ? (
                        <MediumPriorityIcon />
                      ) : element[index].title === "High" ? (
                        <HighPriorityIcon />
                      ) : element[index].title === "Urgent" ? (
                        <UrgentPriorityIcon />
                      ) : (
                        <NoPriorityIcon />
                      )}
                    </div>
                  ) : (
                    <CancelledIcon />
                  )}
                  <span>
                    {element[index]?.title} {element[index].value?.length}
                  </span>
                </div>
                <div className="rightView">
                  <AddIcon />{" "}
                  <ThreeDotMenu style={{ letterSpacing: "2px" }} />
                </div>
              </div>
              <div className="dashList flex-gap-10">
                {element[index]?.value?.map((element, ind) => {
                  return (
                    <Card
                      key={ind}
                      id={element.id}
                      title={element.title}
                      tag={element.tag}
                      status={element.status}
                      priority={element.priority}
                    />
                  );
                })}
              </div>
            </div>
          );
        })}
      </div>
    )
  );
};

export default DashBoard;
